import React, { Component } from "react";
import { Menu, Icon, Input, Button, Avatar, Badge } from "antd";
import { MenuItem } from "rc-menu";

const { SubMenu } = Menu;
const { Search } = Input;

class AppNavbar extends Component {
  state = { menuItemWitdh: "150" };
  render() {
    return (
      <Menu mode="horizontal">
        <Menu.Item key="home" style={{ width: this.state.menuItemWitdh }}>
          <a href="/">
            <Icon type="home" />
            SUSTechDoc
          </a>
        </Menu.Item>
        <SubMenu></SubMenu>
        <MenuItem style={{ width: this.state.menuItemWitdh, float: "right" }}>
          <span>
            <Badge count={1}>
              <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
            </Badge>
          </span>
        </MenuItem>
        <Menu.Item style={{ width: this.state.menuItemWitdh, float: "right" }}>
          <Search
            placeholder="Search Files"
            onSearch={value => console.log(value)}
          />
        </Menu.Item>
      </Menu>
    );
  }
}

export default AppNavbar;
